export default {
  name: 'User',
  data: function data() {
    return {
      loading: true,
      dialogFormVisible: false,
      search: '',
      currentPage: 1,
      pageSize: 10,
      total: 0,
      tableData: [],
      form: []
    };
  },
  mounted: function mounted() {
    this.onload();
  },
  methods: {
    close: function close() {
      this.onload();
    },
    handleEdit: function handleEdit(index, row) {
      // console.log(index, row)
      this.form = row;
      this.dialogFormVisible = true;
    },
    handleSizeChange: function handleSizeChange(size) {
      this.pageSize = size;
      this.onload();
    },
    handleCurrentChange: function handleCurrentChange(currentPage) {
      this.currentPage = currentPage;
      this.onload();
    },
    onload: function onload() {
      var _this = this;

      var params = new URLSearchParams();
      params.append('page', this.currentPage);
      params.append('limit', this.pageSize);
      this.$http.post(this.$url + 'user/getUsersList', params).then(function (res) {
        _this.loading = true;

        if (res.data.code === 2001) {
          // console.log('请求成功')
          _this.tableData = res.data.data;
          _this.total = res.data.count;
          _this.loading = false;
        }

        if (res.data.code === 2004) {
          // console.log('请求失败')
          _this.loading = false;
        }
      });
    },
    onSumbit: function onSumbit() {
      var _this2 = this;

      this.$http.post(this.$url + 'user/updateUser', this.form).then(function (res) {
        if (res.data.code === 2001) {
          _this2.$message({
            message: '修改成功',
            type: 'success'
          });

          _this2.dialogFormVisible = false;
        }

        if (res.data.code === 2004) {
          _this2.$message.error('修改失败');
        }
      });
    }
  }
};
